import React, { useState } from "react";
import ExpenseDate from "./ExpenseDate";
import "./ExpenseItem.css";

const ExpenseItem = (props) => {
  const [title, setTitle] = useState(props.title);

  function clickHandle() {
    setTitle("Updated");
  }
  return (
    <div className="mt-4">
      <div className=" container expenseBg">
        <div className="expenseItem  rounded ">
          <div className=" d-flex text-light">
            <ExpenseDate month="August" year={2022} day={22} />
            <h2 className="me-auto  title">{title}</h2>
            <div className=" px-3 pt-3 price m-4 me-4 rounded fs-5 border border-white">
              {props.price}
            </div>
            <button className=" btn btn-primary m-4" onClick={clickHandle}>
              Update
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ExpenseItem;
